import React, { useState } from 'react';





export const InputTask = () => {

    let [messages, setmessage] = useState([
        { message: 'Message1' },
        { message: 'Message2' },
        { message: 'Message3' },
    ])

    return (
        <div>
            <div>
                <input />
                <button>+</button>
            </div>
            {messages.map((el, index) => {
                return <div key={index}>{el.message}</div>
            }
            )}
        </div>
    )
}
